const Container=()=>{
    return (
        <nav className="teal lighten-1">
            <span className="brand-logo" > Fun Room </span>
            <ul>
                <li> <a href="/">Home</a> </li>
                <li> <a href="/">About Us </a> </li>
            </ul>
            <ul className="right">
               <li> <a href="/login"> Login </a> </li>
                <li> <a href="/signup"> Signup </a> </li>
            </ul>
        </nav>
    );
}
export default Container;
